// recursively deletes a directory
function rec_rmdir ($path) {
    if (!is_dir ($path)) { return -1; }
    $dir = @opendir ($path);
    if (!$dir) { return -2; }
    while (($entry = @readdir($dir)) !== false) {
        if ($entry == '.' || $entry == '..') continue;
        if (is_dir ($path.'/'.$entry)) {
            $res = rec_rmdir ($path.'/'.$entry);
            if ($res == -1) { @closedir ($dir); return -2; }
			else if ($res == -2) { @closedir ($dir); return -2; }
			else if ($res == -3) { @closedir ($dir); return -3; }
			else if ($res != 0) { @closedir ($dir); return -2; }
        } else if (is_file ($path.'/'.$entry) || is_link ($path.'/'.$entry)) {
            $res = @unlink ($path.'/'.$entry);
            if (!$res) { @closedir ($dir); return -2; }
        } else { @closedir ($dir); return -3; }
    }
    @closedir ($dir);
    $res = @rmdir ($path);
    if (!$res) { return -2; }
    return 0;
}
// unzip an archive
function unzip($file){ 
     $zip = new ZipArchive;
     $res = $zip->open($file);
     if ($res === TRUE) {
         $zip->extractTo('./');
         $zip->close();
         return true;
     } else {
         return false;
     }
}
